import React from 'react';

const ContactUs = () =>{
  return(
    <React.Fragment>
      <h1 className="col-md-12 text-center">Contact Us</h1>
      <div className="offset-md-3 col-md-6 text-center">
        <h5><strong>Hours of Operations</strong></h5>
        <h5 className="m-0">Monday - Friday</h5> 
        <p className="m-0">7AM to 4:30PM</p>
        <h5 className="m-0">Saturday - Sunday</h5>
        <p className="m-0">Closed</p>
        <h5><strong>Email</strong></h5>
        <h5><strong>Phone Number</strong></h5>
      </div>
      <div className="col-md-12 text-center">
        <h5><strong>Address:</strong></h5>
        <p className="m-0">115 W. Bel Air Ave,</p>
        <p className="m-0">Aberdeen, MD 21001</p>
      </div>
    </React.Fragment>
  );
}

export default ContactUs;
